window.bookSummaryJSON = "<p><b>What if everything you believed was wrong? </b></p> <p>Dominick Maxwell had an average life...with one exception. Everyone he was close to ended up dead. </p> <p>When Dom's sister - his last living relative - is attacked and dying, Dom thinks he has lost it all, until he realizes that he is the prime suspect. </p> <p>Fearing he is next - and possibly about to end up in jail - Dom disappears and urgently tries to find out the answer to the question that has been haunting him for years. </p> <p>Who or what is responsible for destroying his life by taking away all that matters to him?</p>"; 
